import React from 'react';
import './SymptomList.css';

function SymptomList({ symptoms, onAddSymptom }) {
  return (
    <div className="symptom-list-container">
      <h3>Symptom Search</h3>
      {/* Add search input and search results */}
      {/* Example: */}
      <input type="text" placeholder="Search Symptoms" />
      <div className="search-results">
        {/* Example results (can be dynamically rendered based on search) */}
        <div className="result-item">Symptom 1</div>
        <div className="result-item">Symptom 2</div>
        <div className="result-item">Symptom 3</div>
      </div>

      {/* Button to create a new symptom */}
      <button className="create-symptom-button" onClick={() => onAddSymptom('New Symptom')}>
        Create New Symptom
      </button>
    </div>
  );
}

export default SymptomList;
